import React, { useState } from 'react';
import BudgetEditor from './BudgetEditor';

const BudgetView = ({ presupuestos, pacientes, onAddBudget, onEditBudget }) => {
  const [selectedBudget, setSelectedBudget] = useState(null);
  const [showBudgetEditor, setShowBudgetEditor] = useState(false);

  const getPatientName = (id) => {
    const patient = pacientes.find(p => p.id === id);
    return patient ? `${patient.nombre} ${patient.apellido}` : 'Paciente no encontrado';
  };

  return (
    <div className="space-y-6">
      <div className="flex justify-between items-center">
        <h2 className="text-2xl font-semibold">Presupuestos Dentales</h2>
        <button
          onClick={() => {
            setSelectedBudget(null);
            setShowBudgetEditor(true);
          }}
          className="px-4 py-2 bg-indigo-600 text-white rounded-lg hover:bg-indigo-700"
        >
          Nuevo Presupuesto
        </button>
      </div>

      {presupuestos.length === 0 ? (
        <div className="bg-white rounded-xl shadow-sm p-6 text-center">
          <p className="text-gray-500">No hay presupuestos registrados</p>
        </div>
      ) : (
        <div className="bg-white rounded-xl shadow-sm overflow-hidden">
          <table className="min-w-full divide-y divide-gray-200">
            <thead className="bg-gray-50">
              <tr>
                <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Paciente</th>
                <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Fecha</th>
                <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Total</th>
                <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Estado</th>
                <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Acciones</th>
              </tr>
            </thead>
            <tbody className="bg-white divide-y divide-gray-200">
              {presupuestos.map(budget => (
                <tr key={budget.id} className="hover:bg-gray-50">
                  <td className="px-6 py-4 whitespace-nowrap text-sm font-medium text-gray-900">
                    {getPatientName(budget.pacienteId)}
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-500">
                    {new Date(budget.fecha).toLocaleDateString('es-ES')}
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-500">
                    ${budget.items.reduce((sum, item) => sum + item.subtotal, 0).toLocaleString()}
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-500">
                    <span className={`px-2 py-1 rounded-full text-xs ${
                      budget.estado === 'pendiente' ? 'bg-yellow-100 text-yellow-800' :
                      budget.estado === 'aprobado' ? 'bg-green-100 text-green-800' :
                      'bg-red-100 text-red-800'
                    }`}>
                      {budget.estado}
                    </span>
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-500">
                    <button
                      onClick={() => {
                        setSelectedBudget(budget);
                        setShowBudgetEditor(true);
                      }}
                      className="text-indigo-600 hover:text-indigo-900 mr-3"
                    >
                      Editar
                    </button>
                    <button className="text-gray-600 hover:text-gray-900">
                      Ver
                    </button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      )}

      {showBudgetEditor && (
        <BudgetEditor 
          patient={selectedBudget ? pacientes.find(p => p.id === selectedBudget.pacienteId) : null}
          initialBudget={selectedBudget}
          onSaveBudget={(budget) => {
            if (selectedBudget) {
              onEditBudget(budget);
            } else {
              onAddBudget(budget);
            }
            setShowBudgetEditor(false);
          }}
        />
      )}
    </div>
  );
};

export default BudgetView;

